<!DOCTYPE html>
<html>

<head>
    <meta charset='utf-8'>
    <meta http-equiv='X-UA-Compatible' content='IE=edge'>
    <title>Wikipedia - Ana Navarrete</title>
    <meta name='viewport' content='width=device-width, initial-scale=1'>
    <link rel='stylesheet' type='text/css' media='screen' href='main.css'>
    <script src='main.js'></script>
</head>

<body>
    <h1 class="central-textlogo" style="font-size: 1em;" title="Wikipedia">
        <img class="central-featured-logo" src="img/Wikipedia-logo-v2.png" srcset="img/Wikipedia-logo-v2@1.5x.png 1.5x, img/Wikipedia-logo-v2@2x.png 2x" width="200" height="183" alt="Wikipedia">
        <div class="central-textlogo-wrapper">
            <div class="central-textlogo__image sprite svg-Wikipedia_wordmark">
                Wikipedia
            </div>
            <strong class="jsl10n localized-slogan" data-jsl10n="slogan">La enciclopedia libre</strong>
        </div>
    </h1>
    <div class="central-featured" data-el-section="primary links">
        <div class="central-featured-lang lang1" lang="es" dir="ltr">
            <a id="js-link-box-es" href="https://es.wikipedia.org/" title="Español — Wikipedia — La enciclopedia libre" class="link-box" data-slogan="La enciclopedia libre">
                <strong>Español</strong>
                <small><bdi dir="ltr">1&nbsp;571&nbsp;000+</bdi> <span>artículos</span></small>
            </a>
        </div>
        <div class="central-featured-lang lang2" lang="en" dir="ltr">
            <a id="js-link-box-en" href="https://en.wikipedia.org/" title="English — Wikipedia — The Free Encyclopedia" class="link-box" data-slogan="The Free Encyclopedia">
                <strong>English</strong>
                <small><bdi dir="ltr">5&nbsp;994&nbsp;000+</bdi> <span>articles</span></small>
            </a>
        </div>
        <div class="central-featured-lang lang3" lang="ja" dir="ltr">
            <a id="js-link-box-ja" href="https://ja.wikipedia.org/" title="Nihongo — ウィキペディア — フリー百科事典" class="link-box" data-slogan="フリー百科事典">
                <strong>日本語</strong>
                <small><bdi dir="ltr">1&nbsp;185&nbsp;000+</bdi> <span>記事</span></small>
            </a>
        </div>
        <div class="central-featured-lang lang4" lang="de" dir="ltr">
            <a id="js-link-box-de" href="https://de.wikipedia.org/" title="Deutsch — Wikipedia — Die freie Enzyklopädie" class="link-box" data-slogan="Die freie Enzyklopädie">
                <strong>Deutsch</strong>
                <small><bdi dir="ltr">2&nbsp;385&nbsp;000+</bdi> <span>Artikel</span></small>
            </a>
        </div>

        <div class="central-featured-lang lang5" lang="ru" dir="ltr">
            <a id="js-link-box-ru" href="https://ru.wikipedia.org/" title="Russkiy — Википедия — Свободная энциклопедия" class="link-box" data-slogan="Свободная энциклопедия">
                <strong>Русский</strong>
                <small><bdi dir="ltr">1&nbsp;590&nbsp;000+</bdi> <span>статей</span></small>
            </a>
        </div>
        <div class="central-featured-lang lang6" lang="fr" dir="ltr">
            <a id="js-link-box-fr" href="https://fr.wikipedia.org/" title="Français — Wikipédia — L’encyclopédie libre" class="link-box" data-slogan="L’encyclopédie libre">
                <strong>Français</strong>
                <small><bdi dir="ltr">2&nbsp;171&nbsp;000+</bdi> <span>articles</span></small>
            </a>
        </div>
        <div class="central-featured-lang lang7" lang="it" dir="ltr">
            <a id="js-link-box-it" href="https://it.wikipedia.org/" title="Italiano — Wikipedia — L'enciclopedia libera" class="link-box" data-slogan="L'enciclopedia libera">
                <strong>Italiano</strong>
                <small><bdi dir="ltr">1&nbsp;576&nbsp;000+</bdi> <span>voci</span></small>
            </a>
        </div>
        <div class="central-featured-lang lang8" lang="zh" dir="ltr">
            <a id="js-link-box-zh" href="https://zh.wikipedia.org/" title="Zhōngwén — 維基百科 — 自由的百科全書" class="link-box" data-converttitle-hans="Zhōngwén — 维基百科 — 自由的百科全书" data-slogan="自由的百科全書">
                <strong>中文</strong>
                <small><bdi dir="ltr">1&nbsp;090&nbsp;000+</bdi> <span data-convert-hans="条目"
                        id="zh_art">條目</span></small>
            </a>
        </div>
        <div class="central-featured-lang lang9" lang="pt" dir="ltr">
            <a id="js-link-box-pt" href="https://pt.wikipedia.org/" title="Português — Wikipédia — A enciclopédia livre" class="link-box" data-slogan="A enciclopédia livre">
                <strong>Português</strong>
                <small><bdi dir="ltr">1&nbsp;018&nbsp;000+</bdi> <span>artigos</span></small>
            </a>
        </div>
        <div class="central-featured-lang lang10" lang="pl" dir="ltr">
            <a id="js-link-box-pl" href="https://pl.wikipedia.org/" title="Polski — Wikipedia — Wolna encyklopedia" class="link-box" data-slogan="Wolna encyklopedia">
                <strong>Polski</strong>
                <small><bdi dir="ltr">1&nbsp;379&nbsp;000+</bdi> <span>haseł</span></small>
            </a>
        </div>
    </div>
    <div class="search-container">
        <form class="pure-form" id="search-form" action="https://www.wikipedia.org/search-redirect.php" data-el-section="search">
            <fieldset>
                <input type="hidden" name="family" value="wikipedia">
                <input type="hidden" id="hiddenLanguageInput" name="language" value="es">
                <div class="search-input" id="search-input">
                    <label for="searchInput" class="screen-reader-text" data-jsl10n="search-input-label">Search Wikipedia</label>
                    <input id="searchInput" name="search" type="search" size="20" autofocus="autofocus" accesskey="F" dir="auto" autocomplete="off" list="suggestions" style="padding-right: 64px;">
                    <div class=" styled-select js-enabled">
                        <div class="hide-arrow">
                            <label for="searchLanguage" id="jsLangLabel" class="js-langpicker-label">es</label>

                            <div class="styled-select-active-helper"></div>
                        </div>
                        <i class="sprite svg-arrow-down"></i>
                    </div>
                    <div id="typeahead-suggestions"></div>
                </div>
                <button class="pure-button pure-button-primary-progressive" type="submit">
                    <i class="sprite svg-search-icon" data-jsl10n="search-input-button">Search</i>
                </button>
                <input type="hidden" value="Go" name="go">
            </fieldset>
        </form>
    </div>
</body>

</html>
